g.desc:
            var ti = initTmAnalog(24, 1, 7, 'Измерение');
			var min = 0;
			var max = 60;

            var defaultFill = getElementProperty('rect', 'fill');

            initTmAnalogDefaultCommands(ti);

            function update() {
				var percentage = getTmAnalogValue(ti) / (max - min);
				if (percentage > 1) percentage = 1;
				if (percentage < 0) percentage = 0;
				var height = 35 * percentage;
				var y = 2.4 + 35 - height;
				setElementProperty('rect', 'y', y);
				setElementProperty('rect', 'height', height);

				if (isTmAnalogUnreliable(ti)) {
					setElementProperty('rect', 'fill', 'white');
				}
				else {
					if (percentage > 0.8 && !isTmAnalogUnreliable(ti)) {
						setElementProperty('rect', 'fill', '#f44336');
					}
					else {
						setElementProperty('rect', 'fill', defaultFill);
					}
				}
            }

            return update;

